import React from 'react';
import { Line } from "react-chartjs-2";
import "./DefectRate.css"
import * as FaIcons from 'react-icons/fa'



import {
  LineChart_DefectRate, 
} from "variables/charts";


const DefectRate = ({LineChart_DefectRate_Example1}) => {

  if(LineChart_DefectRate_Example1=="HourlyData"){
      var title = "Hourly";
  }
  if(LineChart_DefectRate_Example1=="DailyData"){
      var title = "Daily";
  }
  if(LineChart_DefectRate_Example1=="MonthlyData"){
      var title = "Monthly";
  }
        return (
    <>

            <div className='DefectRate'>

                <div className='DefectRate-header'>
                  <FaIcons.FaChartArea className='DefectRate-icon' size={20} color={'white'}/>
                  <h3 className='DefectRate-title'>{title} Defect Rate Report</h3>
                </div>

              <div className="DefectRate-body">
                  <div className="DefectRate-chart">
                    <Line
                      data={LineChart_DefectRate[LineChart_DefectRate_Example1]}
                      options={LineChart_DefectRate.options}
                    />
                  </div>

              </div>
            </div>

     </>
        )

};

export default DefectRate;
